//imports
import A from '../A/A';
import '../Card/s.css'
//function
const Elementor=(props)=>{
    return(
        <div className="card">
    <div className="card-body">
        <h5 className="card-title">{props.title}</h5>
        <p className="card-text">{props.des}</p>
        <A name="osaid"/>
        </div>
</div>
    )
}
//export
export default Elementor;
